import axios from '../axios'

 export const getDetaiSong = (sid) => new Promise (async (resolve, reject) =>{
    try {
        const response =  await axios({
            url:'/song',
            method: 'get',
            params : {
                id : sid
            }
        })
        resolve(response)
    } catch (error) {
        reject(error)
    }
})
